import {FaTimes} from 'react-icons/fa'
const Tasks = ({task,deletetask}) => {
  return (
    <div className='task'>
      <h3>{task.text}<FaTimes style={{color:'red',cursor:'pointer'}} 
      onClick={()=> deletetask(task.id)}/></h3>  
      <p>{task.day}</p>
    </div>
  )
}
export default Tasks
